import React from 'react';

class Login extends React.Component<any> {
    constructor(props: any) {
        super(props);
    }

    render() {
        return (
        <form>
      
            <label>Email</label>
            <input type="text" name="email" />
            
            <label>Mot de passe</label>
            <input type="password" name="password" />
            
        </form>
        );
    }
}

export default Login;
